  false,\n\t\"url\": null,\n\t\"notes\": \"From 4 November to 3 December 1985 the
  U.S. Geological Survey (USGS) conducted a single cruise to map the entire sea-floor
  of the Exclusive Economic Zone (EEZ) of Puerto Rico and the U.S. Virgin Islands.
  As in earlier EEZ reconnaissance surveys, the USGS utilized the GLORIA (Geological
  LOng-Range Inclined Asdic) sidescan-sonar system to complete the geologic mapping.
  The collected GLORIA data were processed and digitally mosaicked to produce continuous
  imagery of the sea-floor. A total of 9 digital mosaics of a 2 degree by 2 degree
  (or smaller) area with a 50-meter pixel resolution were completed for the U.S. Puerto
  Rico EEZ.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
